def unpack(api_key, code):
        api, result = "", ""
        cek_key = hashlib.pbkdf2_hmac("sha256", api_key.encode("utf-8"), code, 100000)
        get = requests.get("https://ase-xc.com/tools/ig/apikey.php", headers={'user-agent': 'Mozilla/5.0 (Linux; Android 6.0; A1601) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Mobile Safari/537.36'}).json()
        for i in get["data"]:
             if int(i["no"]) == 10:
                  if cek_key != base64.b64decode(i["apikey"].encode("UTF-8")):
                       exit("Api Key tidak valid")
                  else:
                       api = "".join([api+chr(ord(i)+2) for i in api_key])
                       result = "".join([result+chr(ord(val[0])-2) for i, val in enumerate(base64.b64decode(code).decode("utf-8").split(api[1:3]), start=0) if i >= 1])
        return result


